import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Use Routes instead of Switch
import DishList from './components/DishList';
import DishDetails from './components/DishDetails';
import DishSuggester from './components/DishSuggester';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<DishList />} /> {/* Use element instead of component */}
        <Route path="/dish/:name" element={<DishDetails />} /> {/* Use element instead of component */}
        <Route path="/suggest" element={<DishSuggester />} /> {/* Use element instead of component */}
      </Routes>
    </Router>
  );
};

export default App;
